import React from 'react';
import './Dropdowns.css';

const Dropdowns = (props) => {
    var dropdownsOption = props.value.map((element, i) =>  {<option key={i + element.id}>{element.value}</option>}
    )
   return(
       <div className="dropdown-main-container">
            <select>
              {dropdownsOption}
            </select>
       </div>
   )
}

export default Dropdowns
